import { useState } from "react"

const FirstPage = (props) => {
    const [listStatus,setListStatus] = useState("")
    return (
        <div className='home-body-container'>
            <div className='Application-context'>
                <div className='Current-location-container'>
                    <div>Application context</div>
                    <div>Give details of the applicant's current location</div>
                    <div>Current location: VIETNAM</div>
                    <div className='status'>
                        <span className='title-status'>Legal status:</span>
                        <select>
                            {listStatus && listStatus.length > 0 && listStatus.map((item, index) => {
                                return (
                                    <option key={index} value={item.keyMap}>
                                        {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                    </option>
                                )
                            })}
                        </select>
                    </div>
                    <div className='Current-location'>
                        <span>Will the applicant be accompanied by dependent children at any time during their stay in Australia on this visa?</span>
                        <div className='form-check parent'>
                            {listChoice && listChoice.length > 0 && listChoice.map((item, index) => {
                                return (
                                    <>
                                        <div class="form-check-label child" >
                                            <input class="form-check-input" type="radio" name="children" />
                                            <option key={index} value={item.keyMap}>
                                                {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                            </option>
                                        </div>
                                    </>
                                )
                            })}
                        </div>

                        <span>
                            Has the applicant been granted and entered Australia on a Working Holiday visa (subclass 417) before?
                        </span>
                        <div className='form-check parent'>
                            {listChoice && listChoice.length > 0 && listChoice.map((item, index) => {
                                return (
                                    <>
                                        <div class="form-check-label child" >
                                            <input class="form-check-input" type="radio" name="applicant_before" />
                                            <option key={index} value={item.keyMap}>
                                                {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                            </option>
                                        </div>
                                    </>
                                )
                            })}
                        </div>
                    </div>

                </div>
                <div className='Application-Type'>
                    <div>Select the type of work and holiday visa the applicant is applying for:</div>
                    <div class="form-check parent">
                        {lisTypeOfWork && lisTypeOfWork.length > 0 && lisTypeOfWork.map((item, index) => {
                            return (
                                <div class="form-check-label child" >
                                    <input class="form-check-input" type="radio" name="type" />
                                    <option key={index} value={item.keyMap}>
                                        {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                    </option>
                                </div>
                            )
                        })}
                    </div>

                    <div className='Application-Type-Down'>
                        <span>
                            Has the applicant been granted and entered Australia on a first Work and Holiday visa (subclass 462) before?
                        </span>
                        <div className='form-check parent'>
                            {listChoice && listChoice.length > 0 && listChoice.map((item, index) => {
                                return (
                                    <>
                                        <div class="form-check-label child" >
                                            <input class="form-check-input" type="radio" name="applicant_first" />
                                            <option key={index} value={item.keyMap}>
                                                {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                            </option>
                                        </div>
                                    </>
                                )
                            })}
                        </div>
                    </div>
                </div>
                <div className='Proposed-arrival-date'>
                    <div className='datepicker'>
                        <span className='title-date'>Proposed arrival date:</span>
                        <DatePicker
                            className="col-2"
                            value={this.state.currenDate[0]}
                            onChange={this.handleOnChangeDatePicker}
                        />    <span> <i className='fas fa-calendar-alt'
                        /> </span>
                    </div>
                </div>
                <div className='Government-support'>
                    <div>Does the applicant have a letter of government support to attach to this visa application?</div>
                    <div class="form-check parent">
                        {listChoice && listChoice.length > 0 && listChoice.map((item, index) => {
                            return (
                                <div class="form-check-label child" >
                                    <input class="form-check-input" type="radio" name="government" />
                                    <option key={index} value={item.keyMap}>
                                        {language === LANGUAGES.VI ? item.valueVi : item.valueEn}
                                    </option>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </div>

        </div>
    )
}
export default FirstPage;
